            <button className={style.btn} onClick={() => navigate('/home')}>Home</button>
            <button className={style.btn} onClick={() => navigate('/addgame')} >Add Game</button>
            <button className={style.btn} onClick={() => navigate('/about')}>About Me</button>
        </div>
    )
}
